"about.close_button_label":"Schließen","credits.modal_title":"Songinfos","credits.close_button_label":"Schließen","credits.suggest_edits":"Änderungen vorschlagen","credits.source":"Quelle","credits.performers":"Interpret","credits.writers":"Geschrieben von","credits.songwriters":"Komponisten","credits.producers":"Produziert von","offline-progress-msg":"Song {0} von {1} wird heruntergeladen.","tos.updated_terms":"Aktualisierte Nutzungsbedingungen","tos.modal_title":"Spotify Nutzungsbedingungen","tos.tos_text":'<p>Wir haben unsere <a href="{0}">Nutzungsbedingungen</a> und unsere <a href="{1}">Datenschutzerklärung</a> überarbeitet.</p><p>Außerdem stellt dir ab sofort ein anderes Spotify Unternehmen unsere Dienste bereit: das schwedische Unternehmen Spotify AB.</p><p>Indem du „Akzeptieren“ anklickst, stimmst du den überarbeiteten Bedingungen sowie der Übertragung deines Vertrags an Spotify AB zu. Bitte nimm dir daher ein paar Minuten Zeit, um die neuen Bestimmungen sorgfältig durchzulesen.</p>',"tos.not_now_tos_text":'<p>Wir haben unsere <a href="{0}">Nutzungsbedingungen</a> und unsere <a href="{1}">Datenschutzerklärung</a> überarbeitet.</p><p>Außerdem stellt dir ab sofort ein anderes Spotify Unternehmen unsere Dienste bereit: das schwedische Unternehmen Spotify AB.</p><p>Indem du „Akzeptieren“ anklickst, stimmst du den überarbeiteten Bedingungen sowie der Übertragung deines Vertrags an Spotify AB zu. Bitte nimm dir daher ein paar Minuten Zeit, um die neuen Bestimmungen sorgfältig durchzulesen.</p>',"tos.tos_text2":"<p>Wenn Du Spotify nicht mehr nutzen möchtest, kannst Du Dein Abonnement über Deine Spotify Abonnementseite kündigen.</p>","tos.not_now_text":"<p>Du kannst Spotify noch {0} Tage nutzen, ohne die aktualisierten Nutzungsbedingungen und Datenschutzrichtlinien zu akzeptieren. Ab diesem Zeitpunkt ist es für die weitere Nutzung von Spotify erforderlich, dass Du die neuen Nutzungsbedingungen akzeptierst. Solange Du Dein Abonnement nicht beendest, erhältst Du weiterhin entsprechend Deines normalen Abrechnungszyklus eine monatliche Rechnung. Wenn Du nicht weiter für Spotify zahlen möchtest, kannst Du Dein Abonnement jederzeit über Deine Abonnementseite von Spotify beenden.</p>","tos.not_now_last_day_text":"<p>Du kannst Spotify noch 1 Tag nutzen, ohne die aktualisierten Nutzungsbedingungen und Datenschutzrichtlinie zu akzeptieren. Wenn Du die neuen Bedingungen bis dahin nicht akzeptiert hast, wirst Du Spotify nicht mehr nutzen können. Solltest Du Dein Abonnement nicht kündigen, wird Dir nach wie vor – Deinem regulären Rechnungszeitraum entsprechend – der monatliche Betrag abgezogen. Wenn Du nicht möchtest, dass Spotify Deine Zahlungsmethode weiterhin belastet, kannst Du Spotify jederzeit über Deine Spotify Abonnementseite kündigen.</p>","tos.not_now_text_germany":'<p>Wir haben unsere <a href="{0}">Nutzungsbedingungen</a> und unsere <a href="{1}">Datenschutzrichtlinie</a> überarbeitet. Wenn du zustimmst, wird die Spotify GmbH deinen Vertrag an Spotify AB, Birger Jarlsgatan 61, 113 56 Stockholm, Schweden übertragen.</p><p>Du kannst Spotify mit dem bestehenden Vertrag bis zum {0} weiter nutzen. Um die Spotify Dienste nach diesem Datum weiter zu nutzen, musst du die neuen Nutzungsbedingungen und die Datenschutzrichtlinie akzeptieren. Indem du „Akzeptieren“ anklickst, stimmst du Folgendem zu: </p><p>a) der Übertragung deines Vertrages von der Spotify GmbH an Spotify AB, <br />b) den überarbeiteten Nutzungsbedingungen und<br/>c) der Erfassung und Verwendung der persönlichen Daten, die in den Abschnitten 4, 5 und 7 der Datenschutzrichtlinie definiert sind.</p>',"tos.not_now_text2_germany":"<p>Du kannst Spotify bis zum {0} weiter nutzen, ohne die aktualisierten Nutzungsbedingungen und die Datenschutzrichtlinie zu akzeptieren. Ab diesem Datum musst Du die neuen Bedingungen akzeptieren, um Spotify weiter nutzen zu können. Wenn Du Premium Benutzer bist, wird Dir dieser Dienst auch weiterhin monatlich entsprechend Deines normalen Abrechnungszeitraums in Rechnung gestellt, bis Du Dein Abonnement kündigst. Wenn Du Spotify nicht mehr bezahlen möchtest, kannst Du Dein Abonnement jederzeit über Deine Spotify Abonnementseite beenden.</p>","tos.not_now_expired_text_germany":'<p>Wir haben unsere <a href="{0}">Nutzungsbedingungen</a> und unsere <a href="{1}">Datenschutzrichtlinie</a> überarbeitet.</p><p>Wenn du zustimmst, wird die Spotify GmbH deinen Vertrag an Spotify AB, Birger Jarlsgatan 61, 113 56 Stockholm, Schweden übertragen.</p><p>Um die Spotify Dienste weiter zu nutzen, musst du die neuen Nutzungsbedingungen und die Datenschutzrichtlinie akzeptieren. Indem du „Akzeptieren“ anklickst, stimmst du Folgendem zu:</p><p>a) der Übertragung deines Vertrages von der Spotify GmbH an Spotify AB,<br />b) den überarbeiteten Nutzungsbedingungen und<br/>c) der Erfassung und Verwendung der persönlichen Daten, die in den Abschnitten 4, 5 und 7 der Datenschutzrichtlinie definiert sind.</p>',"tos.us_text":'<p>Wir haben die <a href="{0}">Allgemeinen Nutzungsbedingungen</a> für die USA aktualisiert. Bitte lies sie dir vollständig durch. Einige der Neuerungen:</p> <ul><li>Wir haben Abschnitte, die für User in den USA nicht relevant sind, entfernt.</li> <li>Wir haben Abschnitte des Punktes zu Schlichtung überarbeitet.</li> <li>An unserer Datenschutzri<a href="{1}"></a>chtlinie ändert sich bei dieser Aktualisierung nichts.</li></ul><p>Wenn du „Akzeptieren“ auswählst, stimmst du unseren <a href="{0}">Nutzungsbedingungen</a> zu.',"tos.us_not_now_text":{one:"<p>Du kannst Spotify weiter {0} Tag lang nutzen, ohne die aktualisierten Nutzungsbedingungen zu akzeptieren. Wenn du die neuen Bedingungen bis dahin nicht akzeptierst, kannst du Spotify nicht mehr verwenden. Der Dienst wird dir weiterhin monatlich entsprechend deines normalen Abrechnungszeitraums in Rechnung gestellt, bis du dein Abonnement kündigst. Wenn du für Spotify nicht mehr bezahlen möchtest, kannst du dein Abonnement jederzeit kündigen. Rufe hierzu deine Spotify Abonnementseite auf.</p>",other:"<p>Du kannst Spotify weiter {0} Tage lang nutzen, ohne die aktualisierten Nutzungsbedingungen zu akzeptieren. Wenn du die neuen Bedingungen bis dahin nicht akzeptierst, kannst du Spotify nicht mehr verwenden. Der Dienst wird dir weiterhin monatlich entsprechend deines normalen Abrechnungszeitraums in Rechnung gestellt, bis du dein Abonnement kündigst. Wenn du für Spotify nicht mehr bezahlen möchtest, kannst du dein Abonnement jederzeit kündigen. Rufe hierzu deine Spotify Abonnementseite auf.</p>"},"tos.back_button_label":"Zurück","tos.ok_button_label":"OK","tos.agree_button_label":"Akzeptieren","tos.cancel_button_label":"Ablehnen","tos.not_now_button_label":"Nicht jetzt","licenses.modal_title":"Drittanbieter-Lizenzen","licenses.close_button_label":"Schließen","feedback.beta_title":"Betaversion","feedback.beta_text":"Was magst Du und was nicht? Sag es uns.","market.ad":"Andorra","market.ae":"Vereinigte Arabische Emirate","market.ar":"Argentinien","market.at":"Österreich","market.au":"Australien","market.be":"Belgien","market.bg":"Bulgarien","market.bh":"Bahrain","market.bo":"Bolivien","market.br":"Brasilien","market.ca":"Kanada","market.ch":"Schweiz","market.cl":"Chile","market.co":"Kolumbien","market.cr":"Costa Rica","market.cy":"Zypern","market.cz":"Tschechische Republik","market.de":"Deutschland","market.dk":"Dänemark","market.do":"Dominikanische Republik","market.dz":"Algerien","market.ec":"Ecuador","market.ee":"Estland","market.eg":"Ägypten","market.es":"Spanien","market.fi":"Finnland","market.fr":"Frankreich","market.gr":"Griechenland","market.gt":"Guatemala","market.hk":"Hongkong","market.hn":"Honduras","market.hu":"Ungarn","market.ie":"Irland","market.il":"Israel","market.is":"Island","market.it":"Italien","market.jo":"Jordanien","market.jp":"Japan","market.kw":"Kuwait","market.lb":"Libanon","market.li":"Liechtenstein","market.lt":"Litauen","market.lu":"Luxemburg","market.lv":"Lettland","market.ma":"Marokko","market.mc":"Monaco",